import React, { useEffect, useState } from "react";
import axios from "axios";

function App() {
  const [slots, setSlots] = useState([]);
  const [refresh, setRefresh] = useState(false);

  useEffect(() => {
    axios.get("http://localhost:3001/api/parking")
      .then(res => setSlots(res.data))
      .catch(err => console.error(err));
  }, [refresh]);

  const handlePark = () => {
    const vehicleId = "CAR-" + Date.now();
    axios.post("http://localhost:3001/api/parking/park", { vehicleId })
      .then(res => {
        alert(`Parked ${vehicleId} in slot ${res.data.slot.id}`);
        setRefresh(!refresh);
      })
      .catch(err => alert(err.response.data.error));
  };

  const handleUnpark = (id) => {
    axios.post(`http://localhost:3001/api/parking/unpark/${id}`)
      .then(res => {
        alert(`Unparked slot ${id}`);
        setRefresh(!refresh);
      })
      .catch(err => alert(err.response.data.error));
  };

  return (
    <div style={{ padding: "20px" }}>
      <h1>Vehicle Parking System</h1>
      <button onClick={handlePark}>Park a Vehicle</button>
      <ul>
        {slots.map(slot => (
          <li key={slot.id}>
            Slot {slot.id}: {slot.isOccupied ? `Occupied by ${slot.vehicle}` : "Free"}{" "}
            {slot.isOccupied && (
              <button onClick={() => handleUnpark(slot.id)}>Unpark</button>
            )}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
